const mapObj = []

const canvasInit = () => {
    const min = Math.min(config.screen.width, config.screen.height)
    const gap = min / config.screen.cols
    const container = new PIXI.Container()

    for (let row = 0; row < config.screen.rows; row += 1) {
        mapObj.push([])
        for (let col = 0; col < config.screen.cols; col += 1) {
            const square = new PIXI.Graphics()
            const color = map[row][col]
            square.beginFill(color, 0.3)
            square.lineStyle(1, 0xcccccc)
            square.drawRect(col * gap, row * gap, gap, gap)
            square.endFill()
            square.interactive = true
            square.history = {
                0: color
            }

            const colorUpdate = () => {
                setTimeout(() => {
                    if (config.keypress.mousedown === false) return
                    if (config.keypress.mouseActive === false) return
                    if (config.preference.color === null) return
                    square.clear()
                    square.beginFill(config.preference.color)
                    square.lineStyle(1, 0xcccccc)
                    square.drawRect(col * gap, row * gap, gap, gap)
                    square.endFill()
                    map[row][col] = config.preference.color

                    square.history[config.preference.steps] = config.preference.color
                })
            }
            square.mouseover = colorUpdate
            square.mousedown = colorUpdate
            square.back = (step) => {
                if (square.history[step] !== undefined) {
                    const prevColor = square.history[step]
                    square.clear()
                    square.beginFill(prevColor)
                    square.lineStyle(1, 0xcccccc)
                    square.drawRect(col * gap, row * gap, gap, gap)
                    square.endFill()
                    map[row][col] = prevColor
                } else {
                    // ..
                }
            }
            container.addChild(square)

            mapObj[row][col] = square
        }
    }

    // for (let idx = 0; idx < config.preference.colors.length; idx += 1) {
    //     const square = new PIXI.Graphics()
    //     const color = config.preference.colors[idx]
    //     square.beginFill(color)
    //     square.lineStyle(1, 0)
    //     square.drawRect(min - gap, min - (gap * (idx + 1)), gap, gap)
    //     square.endFill()
    //     square.interactive = true
    //     square.click = () => {
    //         config.preference.color = config.preference.colors[idx]
    //     }
    //     container.addChild(square)
    // }

    return container
}

const canvasBack = (step) => {
    for (let row = 0; row < config.screen.rows; row += 1) {
        for (let col = 0; col < config.screen.cols; col += 1) {
            mapObj[row][col].back(step)
        }
    }
}

export { canvasInit as default }
export { canvasInit, canvasBack }
